scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount"); 
fecha_proceso = scriptletContext.get("fecha_proceso");
UIM_MES_FACT = scriptletContext.get("UIM_MES_FACT");
MONTH = scriptletContext.get("MONTH");
UIM_ANIO_FACT = scriptletContext.get("UIM_ANIO_FACT");
FECHA_LIQUIDACION = scriptletContext.get("FECHA_LIQUIDACION");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UIM_FECHA_PROCESO = curr_date+"-"+curr_month+"-"+curr_year;

var insert="";
var insert2="";
var CV_BANCO='';
var CREDITO=0;
var DEBITO=0;
var ACUM_CREDITO=0;
var ACUM_DEBITO=0;
var TITULO='';
var NETO=0;
var ban=1;
var count = 0;

if(queryCount > 0){
    insert+="BEGIN\n"; 
	linea = query_results.split("\n");

	for(i=0; i < linea.length; i++){
	    linea2 = linea[i].split(",");
	    if(linea2.length > 0){
	    	CV_BANCO = linea2[0];
	    	CREDITO = parseFloat(linea2[1]);
	    	DEBITO = parseFloat(linea2[2]);
	    	if(CREDITO > 0 || DEBITO >0){
	    	NETO = parseFloat(DEBITO - CREDITO);
	    	TITULO = "LIQUIDACION INTERBANCARIA DE ACLARACIONES "+MONTH+" "+UIM_ANIO_FACT;
	    	ACUM_CREDITO = ACUM_CREDITO + CREDITO;
	    	ACUM_DEBITO = ACUM_DEBITO + DEBITO;
	    	insert += "INSERT INTO LIQUIDACIONES (FECHA_CONTABLE_LIQUIDACION,CODIGO_BANCO_LIQUIDACION,TITULO_LIQUIDACION,DEBITO_LIQUIDACION,CREDITO_LIQUIDACION,NETO_LIQUIDACION,FECHA_INICIO_LIQUIDACION,FECHA_FIN_LIQUIDACION,INTERFASE) VALUES (TO_DATE('"+FECHA_LIQUIDACION+"','DD-MM-YYYY'),'"+CV_BANCO+"','"+TITULO+"',"+DEBITO+","+CREDITO+","+NETO+",TO_DATE('"+UIM_FECHA_PROCESO+"','DD-MM-YYYY'),TO_DATE('"+UIM_FECHA_PROCESO+"','DD-MM-YYYY'),'N');\n";
			insert2 += FECHA_LIQUIDACION+","+CV_BANCO+","+TITULO+","+DEBITO+","+CREDITO+","+NETO+","+UIM_FECHA_PROCESO+","+UIM_FECHA_PROCESO+",N\n";
			count = count + 1;
			insert = insert.replace(/\"/g,"'");
			insert = insert.replace(/null/g,"''");
			}
		  } 
	} // fin for
	insert+="COMMIT;\n";
	insert+="END;";
} // fin if

// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 

if((ACUM_CREDITO).toFixed(2) - (ACUM_DEBITO).toFixed(2) == 0){
  ban = 0;
}else{
  ban = 1;
}

scriptletContext.putGlobal("ACUM_CREDITO", ACUM_CREDITO);
scriptletContext.putGlobal("ACUM_DEBITO", ACUM_DEBITO);
scriptletContext.putGlobal("INSERT_SENTENCE", insert);
scriptletContext.putGlobal("INSERT_SENTENCE2", insert2);
scriptletContext.putGlobal("BAN", ban);
scriptletContext.putGlobal("count", count);
// ===========================================================================================
